CREATE TABLE `t_m_tugas` (
  `ID` INT PRIMARY KEY AUTO_INCREMENT,
  `no_kelompok` VARCHAR(50),
  `tahun_ajaran` VARCHAR(10) NOT NULL,
  `judul` VARCHAR(255) NOT NULL,
  `personil` TEXT,
  `deskripsi` TEXT,
  `jurusan` VARCHAR(100),
  `penguji` VARCHAR(255),
  `pembimbing_1` VARCHAR(255),
  `pembimbing_2` VARCHAR(255),
  `tingkat` varchar(100),
  `lokasi_tugas` VARCHAR(100),
  `jenis_tugas` INT,
  `status` VARCHAR(50),
  `id_tugas` VARCHAR(50),
  `dokumen` TEXT,
  `subject` VARCHAR(255)
);


SELECT
    t_m_tugas.judul,
    t_m_tugas.personil AS penulis,
    CONCAT_WS(', ', t_m_tugas.pembimbing_1, t_m_tugas.pembimbing_2) AS pembimbing,
    t_m_tugas.penguji,
    'Fakultas Teknologi Informasi' AS fakultas, -- Sesuaikan jika ada data fakultas
    t_m_tugas.jurusan AS prodi,
    'Tanpa Kata Kunci' AS katakunci, -- Jika tidak ada kata kunci di tabel asal
    t_m_tugas.tahun_ajaran AS tahun,
    t_m_tugas.lokasi_tugas AS lokasi,
    COALESCE(t_m_tugas.deskripsi, 'Tidak ada abstrak') AS abstrak
FROM t_m_tugas;

drop table t_m_tugas;
